using System;
using System.Collections.Generic;
using System.Linq;

public abstract class Source
{
    public string Name { get; protected set; }
}

public abstract class Stat
{
    public string Name { get; private set; }
    public int MaxValue { get; private set; }
    public int CurrentValue { get; protected set; }

    public event Action<Source, int, int> OnValueChanged;

    protected Stat(string name, int maxValue)
    {
        Name = name;
        MaxValue = maxValue;
        CurrentValue = MaxValue;
    }

    public virtual void TakeDamage(int damage, Source source)
    {
        int initialValue = CurrentValue;
        CurrentValue -= damage;

        if (CurrentValue < 0)
        {
            CurrentValue = 0;
        }

        int damageDealt = initialValue - CurrentValue;
        OnValueChanged?.Invoke(source, -damageDealt, CurrentValue);
        Console.WriteLine($"{Name} Value: {CurrentValue}");
    }

    public virtual void Restore(int amount, Source source)
    {
        int initialValue = CurrentValue;
        CurrentValue += amount;

        if (CurrentValue > MaxValue)
        {
            CurrentValue = MaxValue;
        }

        int restoredAmount = CurrentValue - initialValue;
        OnValueChanged?.Invoke(source, restoredAmount, CurrentValue);
        Console.WriteLine($"{Name} Value: {CurrentValue}");
    }
}

public class HealthStat : Stat
{
    public HealthStat(string name, int maxValue) : base(name, maxValue) { }
}

public class Shield : Stat
{
    public Shield(string name, int maxValue) : base(name, maxValue) { }

    public override void TakeDamage(int damage, Source source)
    {
        int initialValue = CurrentValue;
        int shieldDamage = Math.Min(damage, CurrentValue);
        CurrentValue -= shieldDamage;
        damage -= shieldDamage;

        int damageDealt = initialValue - CurrentValue;
        OnValueChanged?.Invoke(source, -damageDealt, CurrentValue);
        Console.WriteLine($"{Name} Value: {CurrentValue}");
    }
}

public class Entity : Source
{
    private List<Stat> stats;

    public Entity(string name, params Stat[] stats)
    {
        Name = name;
        this.stats = new List<Stat>(stats);
    }

    public void TakeDamage(int damage, Source source, DamageHandler handler)
    {
        damage = handler.ProcessDamage(damage, source);

        foreach (var stat in stats)
        {
            if (damage <= 0) break;
            int initialStatValue = stat.CurrentValue;
            stat.TakeDamage(damage, source);
            damage -= (initialStatValue - stat.CurrentValue);
        }

        Console.WriteLine($"{Name} Status:");
        foreach (var stat in stats)
        {
            Console.WriteLine($"{stat.Name} Value: {stat.CurrentValue}");
        }
    }

    public void Heal(string statName, int amount, Source source)
    {
        var stat = stats.FirstOrDefault(s => s.Name == statName);
        stat?.Restore(amount, source);
    }
}

public class DamageHandler
{
    public event Func<int, Source, int> OnProcessDamage;

    public int ProcessDamage(int damage, Source source)
    {
        if (OnProcessDamage != null)
        {
            foreach (Func<int, Source, int> handler in OnProcessDamage.GetInvocationList())
            {
                damage = handler(damage, source);
            }
        }
        return damage;
    }
}

public class Ability : Source
{
    public Ability(string name)
    {
        Name = name;
    }
}

public class Weapon : Source
{
    public Weapon(string name)
    {
        Name = name;
    }
}

public class Program
{
    public static void Main()
    {
        DamageHandler damageHandler = new DamageHandler();
        Shield playerShield = new Shield("Shield", 50);
        damageHandler.OnProcessDamage += playerShield.TakeDamage;

        HealthStat normalHealth = new HealthStat("Normal Health", 100);
        HealthStat armorHealth = new HealthStat("Armor", 75);
        Entity player = new Entity("Player", normalHealth, armorHealth, playerShield);
        Entity enemy = new Entity("Enemy", new HealthStat("Normal Health", 80));
        Ability healingSpell = new Ability("Healing Spell");
        Weapon sword = new Weapon("Sword");

        playerShield.OnValueChanged += (source, amount, value) => 
            Console.WriteLine($"{source.Name} affected shield. Changed by {amount}. Current Value: {value}");
        normalHealth.OnValueChanged += (source, amount, value) => 
            Console.WriteLine($"{source.Name} affected normal health. Changed by {amount}. Current Value: {value}");
        armorHealth.OnValueChanged += (source, amount, value) => 
            Console.WriteLine($"{source.Name} affected armor health. Changed by {amount}. Current Value: {value}");

        Console.WriteLine("Initial State:");
        Console.WriteLine($"Normal Health: {normalHealth.CurrentValue}, Armor Health: {armorHealth.CurrentValue}, Shield: {playerShield.CurrentValue}");

        player.TakeDamage(30, enemy, damageHandler);
        player.Heal("Normal Health", 20, healingSpell);
        player.TakeDamage(50, sword, damageHandler);
        playerShield.Restore(40, healingSpell);
        player.TakeDamage(80, enemy, damageHandler);
        player.Heal("Normal Health", 50, healingSpell);
        playerShield.Restore(30, healingSpell);

        Console.WriteLine("Final State:");
        Console.WriteLine($"Normal Health: {normalHealth.CurrentValue}, Armor Health: {armorHealth.CurrentValue}, Shield: {playerShield.CurrentValue}");
    }
}

using AmirSql.Database;
using System;
using System.Threading.Tasks;
using System.Windows.Forms;

namespace Sinaa_Project.Database
{
    public class Accounts
    {
        public enum AccountState : byte
        {
            DoesntExist = 0,
            Banned = 1,
            User = 2,
            conter = 3,
            ProjectManager = 4,
            RegionalDirector = 5,
            RegionalManager = 6,
            Assistant = 7
        }
        private readonly MySql.Data.MySqlClient.MySqlConnection _connection;
        public Accounts()
        {
            _connection = new MySql.Data.MySqlClient.MySqlConnection(Program.connection("db_sql", ""));
        }
        public bool Logins { get; set; }
        public string Username { get; set; }
        public string Password { get; set; }
        public string Mobile { get; set; }
        public string Email { get; set; }
        public string Full_Name { get; set; }
        public DateTime LastCheck { get; set; }
        public AccountState State { get; set; }
        public uint UID { get; set; }
        public byte[] ImageBytes { get; set; }
        public void DB_Where(string user)
        {
            try
            {
                using (MySql.Data.MySqlClient.MySqlCommand command = new MySql.Data.MySqlClient.MySqlCommand("SELECT * FROM accounts WHERE Username = @Username", _connection))
                {
                    command.Parameters.Add("@Username", MySql.Data.MySqlClient.MySqlDbType.VarChar).Value = user;
                    _connection.Open();
                    using (MySql.Data.MySqlClient.MySqlDataReader reader = command.ExecuteReader())
                    {
                        if (reader.Read())
                        {
                            UID = reader.GetUInt32(0);
                            Username = reader.GetString(1);
                            Password = reader.GetString(2);
                            Mobile = reader.GetString(3);
                            Email = reader.GetString(4);
                            LastCheck = reader.IsDBNull(5) ? DateTime.Now : reader.GetDateTime(5);
                            State = (AccountState)reader.GetUInt32(6);
                            Full_Name = reader.GetString(7);
                            ImageBytes = reader["image_profile"] as byte[];
                        }
                    }
                }
            }
            finally
            {
                if (_connection.State == System.Data.ConnectionState.Open)
                    _connection.Close();
            }
        }
        public void DB_Where(int uid)
        {
            try
            {
                using (MySql.Data.MySqlClient.MySqlCommand command = new MySql.Data.MySqlClient.MySqlCommand("SELECT * FROM accounts WHERE id = @UID", _connection))
                {
                    command.Parameters.Add("@UID", MySql.Data.MySqlClient.MySqlDbType.Int32).Value = uid;
                    _connection.Open();
                    using (MySql.Data.MySqlClient.MySqlDataReader reader = command.ExecuteReader())
                    {
                        if (reader.Read())
                        {
                            UID = reader.GetUInt32(0);
                            Username = reader.GetString(1);
                            Password = reader.GetString(2);
                            Mobile = reader.GetString(3);
                            Email = reader.GetString(4);
                            LastCheck = reader.IsDBNull(5) ? DateTime.Now : reader.GetDateTime(5);
                            State = (AccountState)reader.GetByte(6);
                            Full_Name = reader.GetString(7);
                            ImageBytes = reader["image_profile"] as byte[];
                        }
                    }
                }
            }
            finally
            {
                if (_connection.State == System.Data.ConnectionState.Open)
                    _connection.Close();
            }
        }
        
        public void Last_Login()
        {
            using (MySql.Data.MySqlClient.MySqlConnection conn = new MySql.Data.MySqlClient.MySqlConnection(Program.connection("db_sql", "")))
            {
                conn.Open();
                string sql = "UPDATE accounts SET LastCheck = @NewDateTime WHERE Username = @RecordId";
                using (MySql.Data.MySqlClient.MySqlCommand cmd = new MySql.Data.MySqlClient.MySqlCommand(sql, conn))
                {
                    cmd.Parameters.AddWithValue("@NewDateTime", DateTime.Now);
                    cmd.Parameters.AddWithValue("@RecordId", this.Username);
                    int rowsAffected = cmd.ExecuteNonQuery();
                    if (rowsAffected > 0)
                        conn.Close();
                    else
                        conn.Close();
                }
            }
        }
        public static void Update_UserAdd(string NewPass, string f_name, string mobile, string email, int state, byte[] imageBytes, int id)
        {
            try
            {
                using (var cmd = new AmirSql.Database.MySqlCommand(AmirSql.Database.MySqlCommandType.UPDATE))
                    cmd.Update("accounts").Set("Password", NewPass).Set("Full_Name", f_name).Set("Mobile", mobile).Set("Email", email).Set("State", state).Where("id", id).Execute();
                using (MySql.Data.MySqlClient.MySqlConnection connection = new MySql.Data.MySqlClient.MySqlConnection(Program.connection("db_sql", "")))
                {
                    string query = "UPDATE accounts SET image_profile = @imageData WHERE id = @Id";
                    MySql.Data.MySqlClient.MySqlCommand command = new MySql.Data.MySqlClient.MySqlCommand(query, connection);
                    command.Parameters.AddWithValue("@imageData", imageBytes);
                    command.Parameters.AddWithValue("@Id", id);

                    connection.Open();
                    int rowsAffected = command.ExecuteNonQuery();
                    if (rowsAffected > 0)
                        connection.Close();
                    else
                        connection.Close();
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("حدث خطأ أثناء استبدال الصورة في قاعدة البيانات: " + ex.Message);
            }
        }
        public static void Insert_UserAdd(string NewPass, string f_name, string mobile, string email, int state, byte[] imageBytes, string user)
        {
            try
            {
                using (var cmd = new AmirSql.Database.MySqlCommand(AmirSql.Database.MySqlCommandType.INSERT))
                    cmd.Insert("accounts").Insert("Username", user)
                        .Insert("Password", NewPass).Insert("Mobile", mobile).Insert("Email", email).Insert("State", state).Insert("Full_Name", f_name)
                        .Execute();
                using (MySql.Data.MySqlClient.MySqlConnection connection = new MySql.Data.MySqlClient.MySqlConnection(Program.connection("db_sql", "")))
                {
                    string query = "UPDATE accounts SET image_profile = @imageData WHERE Username = @Username";
                    MySql.Data.MySqlClient.MySqlCommand command = new MySql.Data.MySqlClient.MySqlCommand(query, connection);
                    command.Parameters.AddWithValue("@imageData", imageBytes);
                    command.Parameters.AddWithValue("@Username", user);

                    connection.Open();
                    command.ExecuteNonQuery();
                    connection.Close();
                }
            }
            catch (Exception ex)
            {
                MessageBox.Show("حدث خطأ أثناء استبدال الصورة في قاعدة البيانات: " + ex.Message);
            }
        }
    }
}

